import React from "react";
import "./SignInForm.css";
import "react-bootstrap";
import { Button, Form, FormGroup } from "react-bootstrap";
import chatIcon from "../img/chat-app-icon.png";

const SignInForm = () => {
  return (

      <div className="wrapper">

              <div className="text-center pa-3"><img src={chatIcon} className="chatIcon" alt="chat-icon"></img></div>
              <div className="text-center mt4 name">Sign in to Chat</div>
             <form className="p-3 mt-3 text-center">
               <div className="form-field"> <span className="far fa-user"></span> <input type="text" name="userName" id="userName" placeholder="Username"></input></div>
               <div className="form-field d-flex align-items-center"> <span className="far fa-key"></span> <input type="password" name="password" id="password" placeholder="Password"></input></div>
               <button className="btn mt-3">Login</button>
                </form>
                <div className="text-center fs-6"> Not a member? <a> Sign Up</a></div>
           </div>
  );
};

export default SignInForm;
